#include<bits/stdc++.h>
using namespace std;
int T,n,m,k;
char s[11111]="";
int ok[111][111];
int main()
{
	ios_base::sync_with_stdio(false);
	int cur=0;
	for(int i=63;i>=0;i--)
	{
		for(int j=0;j<16;j++)
		{
			int t;
			if(isdigit(s[cur]))t=s[cur]-'0';
			else t=s[cur]-'A'+10;
			if(t&8)ok[i][j*4]=1;
			if(t&4)ok[i][j*4+1]=1;
			if(t&2)ok[i][j*4+2]=1;
			if(t&1)ok[i][j*4+3]=1;
			cur++;
		}
	}
	for(int i=0;i<=63;i++)
	{
		for(int j=0;j<=63;j++)
		{
			cerr<<(ok[i][j]?'#':' ');
		}
		cerr<<endl;
	}
	cin>>n>>m;
	cout<<(ok[n][m]==0?"IN":"OUT")<<endl;
	return 0;
}